import React from 'react'
import { useAppDispatch, useAppSelector } from '../Hooks/hooks';

export default function Summary() {
    const dispatch = useAppDispatch();
    const skills = useAppSelector(state => state.skills);
    const userData = useAppSelector(state => state.userData);

    return (
        <div>
            <h1>Does this sound right?</h1>
            <hr></hr>
            <div>My name is {userData.name}</div>
            <div>I'm from {userData.location}</div>
            {userData.education == 'None' ? <div>No previous education</div> : <div>I have a {userData.education}</div>}
            <div>From {userData.schoolName}</div>
            <div>These are my skills:</div>
            {skills.map((skill) => { return <div>{skill}</div> })}
            <hr></hr>

            <div>I'm applying for the positon of {userData.position}</div>
            <div>At {userData.companyName}</div>
            <div>{userData.extraComments}</div>
        </div>
    )
}
